// import { render } from '@testing-library/react';
import React from 'react'
import Slider from "react-slick";

import { Helmet } from 'react-helmet';
import figure1 from '../image/fig1.webp';
import figure2 from '../image/fig2.webp';
import figure3 from '../image/fig3.webp';
import figure4 from '../image/fig4.webp';
import figure5 from '../image/fig5.webp';
// import figure6 from '../image/fig6.webp';

function ExternalLinks() {
    

        var settings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 4,
            slidesToScroll: 1,
            initialSlide: 0,
            responsive: [
                {
                    breakpoint: 1024,
                    settings: {
                        slidesToShow: 3,
                        slidesToScroll: 3,
                        infinite: true,
                        dots: true
                    }
                },
                {
                    breakpoint: 600,
                    settings: {
                        slidesToShow: 2,
                        slidesToScroll: 2,
                        initialSlide: 2
                    }
                },
                {
                    breakpoint: 480,
                    settings: {
                        slidesToShow: 1,
                        slidesToScroll: 1
                    }
                }
            ]
        };
        return (
            <div>
                <Helmet>
                    <link rel="stylesheet" type="text/css" charset="UTF-8" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick.min.css" />
                    <link rel="stylesheet" type="text/css" href="https://cdnjs.cloudflare.com/ajax/libs/slick-carousel/1.6.0/slick-theme.min.css" />
                </Helmet>
                <div className="container">
                    <h2> Responsive </h2>
                    <section className="grid clearfix">
                        <Slider {...settings} style={{ width: '80%', padding: '50px', marginLeft: '200px', backgroundColor: '#e5e5e5' }}>
                            <div>
                                <img src={figure1} alt="one" style={{ width: '310px', height: '227px', borderRadius: '20px', boxShadow: '6px 6px 5px rgb(35, 35, 35,0.3)' }} />

                            </div>
                            <div>
                                <img src={figure2} alt="one" style={{ width: '310px', height: '227px', borderRadius: '20px', boxShadow: '6px 6px 5px rgb(35, 35, 35,0.3)' }} />

                            </div>
                            <div>
                                <img src={figure3} alt="one" style={{ width: '310px', height: '227px', borderRadius: '20px', boxShadow: '6px 6px 5px rgb(35, 35, 35,0.3)' }} />

                            </div>
                            <div>
                                <img src={figure4} alt="one" style={{ width: '310px', height: '227px', borderRadius: '20px', boxShadow: '6px 6px 5px rgb(35, 35, 35,0.3)' }} />

                            </div>
                            <div>
                                <img src={figure5} alt="one" style={{ width: '310px', height: '227px', borderRadius: '20px', boxShadow: '6px 6px 5px rgb(35, 35, 35,0.3)' }} />

                            </div>
                            <div>
                                <img src={figure6} alt="one" style={{ width: '310px', height: '227px', borderRadius: '20px', boxShadow: '6px 6px 5px rgb(35, 35, 35,0.3)' }} />
                            </div>
                            <div>
                                <img src={figure4} alt="one" style={{ width: '310px', height: '227px', borderRadius: '20px', boxShadow: '6px 6px 5px rgb(35, 35, 35,0.3)' }} />
                            </div>
                            <div>
                                <img src={figure1} alt="one" style={{ width: '310px', height: '227px', borderRadius: '20px', boxShadow: '6px 6px 5px rgb(35, 35, 35,0.3)' }} />
                            </div>
                        </Slider>
                    </section>
                </div>
            </div>
        );
    }


export default ExternalLinks
